import React from "react";
import './contact.css'
import Header from "../../components/Header/Header";
const contact = ()=>{
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    message: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here
    console.log('Form submitted:', formData);
  };
    return(
        <>
        <Header/>
        <div className="container">
      <div className="contact-section">
        <h1>Contact WayBuddy for Support</h1>
        <div className="contact-options">
          <div className="contact-block">
            <div className="logo" style={{color:"black"}}>logo attach here</div>
            <div className="other">
            <h2>Contact Us</h2>
            <p style={{color:"black"}}>Just want to say hi? We'd love to hear from you. We love our customers and community!</p>
            <button className="contact-button">Send Us A Message</button>
            </div>
          </div>
          <div className="contact-block">
            <div className="logo" style={{color:"black"}}>logo attach here</div>
            <div className="other"><h2>Get Support</h2>
            <p style={{color:"black"}}>Have an issue with an order or with a product you purchased from us? Fill out our support form.</p>
            <button className="contact-button">Contact Support</button></div>
          </div>
        </div>
      </div>
    </div>



    <div className="another">
      <div className="con">
        Contact Us

      </div>
      <div className="form">
        <h1>Contact Form</h1>
        <p>Send us message and we we'll get back to you as soon as we can!</p>
        <form>
          <label htmlFor="Name">Name</label>
          <br/>
          <input type="text" name="f" id="name" placeholder="Enter your name"/>
          <br/>
          <label htmlFor="Email">Email</label>
          <br/>
          <input type="email" name="f" id="Email" placeholder="Enter your email address"/>
          <br/>
          <label htmlFor="Message">Your Message</label>
          <br/>
          <textarea placeholder="Enter your message"></textarea>
          <br/>
          <button className="contact-button">Submit</button>
        </form>
      </div>
    </div>
        </>
    );
};

export default contact;
